VALUES ('40882628', 'Buddha bowl saumon fumé', '88 g de Céréales gourmandes cuisinées (28,4% ) : boulgour fin cuit 13,5% (eau, blé dur concassé précuit), petit épeautre cuit 10% (eau, blé), courgettes, carottes 1,7%, huile de colza, aneth, purée de yuzu, sel. 75,5 g de Crudités (24,4% ) : carottes 10,5%, concombres 9,6%, radis. 59,5 g de Salades mélangées (19,2% ): laitue, chicorée et roquette. 32 g de Saumon fumé (10,3% ) : saumon fumé 9,6 % (saumon Atantique Salmo salar, sel), graines de sésame. 30 g de Fèves de soja cuisinées (9,6%): fèves de soja 6,4%, haricots rouges du Japon, graines de pavot bleu, huile de colza. 25 g de Sauce au soja et au citron vert (8,1% ) : huile de colza, sauce soja 1,8% (eau, graines de soja, blé, sel, sucre, extrait de levure),jus de citron vert 1,3%, poivre', 'https://static.openfoodfacts.org/images/products/40882628/front_fr.18.400.jpg', '8.4', '1', '8.6', '2.3', '2.7', '5', '0.86', '0.338582677165354', '', '1');

