VALUES ('4099200015859', 'Barre protéinées', 'Barre proteinée au goût de banane, enrichies en vitamines, enrobées de chocolat au lait (17 %). Sans gluten. Ingrédients protéines lactiques,sirop d\'oligofructose, sirop de sucre inverti, sirop de glucose, sucre, humectant:glycérol;gélatine alimentaire (boeurf),lait entier en poudre isolat de proteines lactiques,huile de palme, beurre de cacao, cacao en pâte, lactose, aromes naturels, aliments colorants jus de carottes concentre, émulsifant:lécithines; DL-alpha-tocophérylacetate, nicotinamide, calcium-D-pantothénate, chlorhydrate de pyridoxine, riboflavine, mononitrate de thiamine, cyanocobalamine. Peut contenir des traces de soja, de sésame, d\'ceuf, de noisettes, de noix de cajou, de noix de macadamia et d\'amandes. Quantité recommandée: 1 barre par jour. Veillez à conserver une alimentation équilibrée et variée ainsi qu\'un mode de vie sain et à pratiquer beaucoup d\'exercice. SANS GLUTEN', 'https://static.openfoodfacts.org/images/products/409/920/001/5859/front_fr.10.400.jpg', '11', '7', '33.3', '21.7', '0', '33.3', '0.0833', '0.0328', '0', '1');

