VALUES ('4099200057231', 'Haselnuss Schokolade', 'Vollmilchschokolade mit gehackten Haselnüssen Zutaten: Zucker, Vollmilchpulver, Kakaobutter, Kakaomasse, Haselnüsse (12%), Haselnussmasse, Emulgator(Soja - lecithin), Vanilleextrakt. Kann Spuren von Erdnüssen, anderen Nüssen und Weizeneiweiß enthalten. Kakao: 30% mindestens in der Schokolade. Hergestellt von: Hofer KG GewerbestraBe 20, A-4642 Sattledt. Bei Raumtemperatur trocken lagern und nach dem Offnen innerhalb einer Woche verzehren oder aufbrauchen. Chocolat au lait entier noisettes concassées Ingrédients: sucre, lait entier en poudre, beurre de cacao, cacao en pâte, noisettes (12% ), pâte de noisettes, émulsifiant (lécithine de soja), extrait de vanille Peut contenir des traces d\'arachides, d\'autres noix et de protéines de froment. Cacao: 30% minimum dans le chocolat. Produit par: Hofer KG, gewerbestraße 20, A4642 Sattledt. Conserver à température ambiante et au sec. Après ouverture, consommer dans la semaine qui suit. Cioccolato al latte con granella di nocciole. Ingredientic Jatte intero in polvere, burro di cacao, pasta di cacao, nocciole (12%), emulsionante (lecitine di soia), estratto di vaniglia. Può contenere tracce di arachidi, altra frutta a guscio e proteine di grano. Cacao:30% min nel cioccolato al latte. Prodotto per: ALDI S.r.L, Via Sommacampagna 63/H,37137 Verona, Italia. Da: Hofer KG, Gewerbestraße 20, A-4642 Sattledt Conservare in luogo fresco e ascuitto, lontano da fonti di calore. Una volta aperto, consumare entro una settimana. Ungeöffnet mindestens haltbar bis Ende/Fermé, à consommer de préférence avant fin:/In confezione integra, da consumarsi preferibilmente entro fine', 'https://static.openfoodfacts.org/images/products/409/920/005/7231/front_de.10.400.jpg', '33', '17', '51', '51', '', '8.4', '0.25', '0.0984251968503937', '', '0');

