VALUES ('4099200407944', 'poitrine de dinde', 'Charcuterie de poitrine de dinde &quot;barbe Stabilisatoren: Di - und Triphosphate, Milchzucker, Maltodextrin, Kochsalz, Gewürzextrakte (mit Sellerie), Verdickungsmittel: Carrageen, Antioxidationsmittel: Natriumascorbat, Bouillon, natürliche Aromen, Geschmacksverstärker: Mononatriumglutamat, Knoblauchöl, Gewürze geräuchert (Paprika, Koriander). Matriumnitrit), Viande de dinde 740%, eau, sel nitrité pour saumure (sel de cuisine, conservateur: nitrite de sodium), stabilisants: di - et triphosphates, lactose, maltodextrine, sel de cuisine, extraits d\'épices (avec céleri épaississant: carraghénane, antioxydant: ascorbate de sodium, bouillon, arômes naturels, exhausteur de goût: glutamate monosodique, huile d\'ail, épices fumées (paprika, coriandre). Carne di tacchino 740%, acqua, sale nitritato per salamoia (sale da cucina, conservante: nitrito di sodial, stabillizzanti: di - e trifosfati, lattosio, maltodestrina, sale da cucina, estratti di spezie (con sedanol addensante: carragenina, antiossidante: ascorbato di sodio, brodo, aromi naturali, esaltatore di sapidità glutammato monosodico, olio d\'aglio, spezie affumicate (paprica, coriandolo) Herkunft Rohstoffe/ Origine de la matière première/Origine di materia prime Hergestellt in der Schweiz aus Schweizer Fleisch. Elaboré en Suisse avec de la viande suisse. Prodotto in Svizzera con carne svizzera. Trutenfleischerzeugnis gekocht /Unter Schutzatmosphäre verpackt Produit à base de viande de dinde, cuit/', 'https://static.openfoodfacts.org/images/products/409/920/040/7944/front_fr.5.400.jpg', '1.1', '0.5', '1.3', '0.5', '', '20', '2', '0.78740157480315', '', '0');

