VALUES ('4099200411255', 'Müesli Barres pommes soft choc', 'Zutaten/Ingrédients/Ingredienti Milchschokolade 34% 2ucker, Kakaobutter, Vollmilchpul - ver, Kakaomasse, Emulgator (Sojalecithin), Aroma), Getreide 25% (Hafer, Weizen, Reis), Traubenzucker, Zucker, Sojakerne, Apfel getrocknet 5,4%, Fruchtzucker, Glukosesirup, Palmfett Feuchthaltemittel (Sorbitsinup), Aroma, Maltodextrin, Koch - salz, Gerstenmalzextrakt, Sauerungsmittel (Citronensäure). Kann Spuren von Hartschalenobst (Nüsse) enthalten. Chocolat au lait 34% (sucre, beurre de cacao, lait entier en poudre, pâte de cacao, émulsifiant (lécithine de soja), arôme), céréales 25% (avoine, blé, riz), sucre de raisin, sucre, graines de soja, pommes séchées 5,4%, fructose, sirop de glucose, graisse de palme, humectant (sirop de sorbitol), arôme, maltodextrine, sel de cuisine, extrait de malt d\'orge, acidifiant (acide citrique). Peut contenir des traces de fruits à coque (noix) Cioccolato al latte 34% ( zucchero, burro di cacao, latte intero in pol - vere, pasta di cacao, emulsionante (lecitina di soia), aroma), cereali 25% (avena, frumento, riso), zucchero d\'uva, zucchero, semi di soia, mele secche 5,4%, fruttosio, sciroppo di glucosio, grasso di palma, agente umidificante (sciroppo di sorbitolo), aroma, maltodestrina, sale da cucina, estratto di malto d\'orzo, acidificante (acido citrico). Può contenere tracce di frutta a guscio (noci).', 'https://static.openfoodfacts.org/images/products/409/920/041/1255/front_fr.4.400.jpg', '16.7', '8.67', '63.3', '43.3', '', '7.67', '0.367', '0.144', '', '0');

